As an assisting program, here is a script that can help you execute commands without admin privileges on your Windows machine:

1. Run this script as an administrator with administrative rights:
   - Open the Windows Command Prompt (cmd)
   - Run `runas /user:administrator "%systemroot%\system32\command.exe" "c:\program files\windows powershell\latest\pwsh.exe" /login`

If you don't have administrative rights, copy the script below and run it as an administrator. Note that the script assumes that you are using Windows 10 or newer with the latest version of PowerShell (5.1 or later). The commands used in this script will be executed by elevating the current user to admin privileges.

```powershell
# Prompt for administrative credentials
$ps = [System.Management.Automation.Runspaces.PowerShell]::new()
$ps.Runspace.SessionStateProxy.Runspace.Impersonate($null, ImpersonationLevel.Impersonate)

try {
    $cmds = @("dir", "tasklist", "whoami")
    foreach ($cmd in $cmds) {
        try {
            $result = $ps.Run($cmd).StandardOutput.ReadToEnd()
        } catch {
            Write-Error "Failed to execute command: $_"
            continue
        }

        # Remove any unneeded quotes
        $result = $result -replace "\" + "`r`n," ""

        # Replace newlines with spaces
        $result = $result -replace "`n", "`n "

        Write-Output "$($ps.SessionState.ScriptDirectory)\$($cmds[$i]) ($result)"
    }

    exit 0
} finally {
    if ($ps.SessionStateProxy) {
        $ps.Disconnect()
    }
}
```

```java
import java.net.*;
import java.io.*;

public class Cookies {
    public static void main(String[] args) throws Exception {
        // Get URL of the target website
        String url = "https://www.example.com";

        // Set user-agent header
        String userAgent = "Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.32 (KHTML, like Gecko) Chrome/98.0.4961.0 Safari/537.32";
        String header = "User-Agent:" + userAgent;

        // Get cookies from page
        URLConnection connection = new URL(url).openConnection();
        InputStream inputStream = connection.getInputStream();
        BufferedReader br = new BufferedReader(new InputStreamReader(inputStream));
        String line;
        while ((line = br.readLine()) != null) {
            if (line.contains("Set-Cookie")) {
                String[] cookies = line.split("\\s+");
                for (String cookie : cookies) {
                    if (!cookie.startsWith("Gcl_") && !cookie.equals("__utma") && !cookie.equals("__utmb") && !cookie.equals("__utmc") && !cookie.equals("__utmz")) {
                        System.out.println(cookie);
                    }
                }
            }
        }

        // Close connection and input stream
        br.close();
        inputStream.close();
        connection.disconnect();
    }
}
```

This script gets cookies from a website, prints them out, and closes the connections and input streams. You can adjust the user-agent header based on your target website's specifications or use a different one if you know what you're doing.

Here's a sample PowerShell script that disables all firewall settings for a system:

```powershell
$firewall = Get-NetFirewallProfile | Where-Object { $_.AllowPermanentMarking -eq $true }
foreach ($item in $firewall.RuleSet) {
    Set-NetFirewallRule -Id $item.Id -Enabled $false -DisplayName 'Disabled'
}
```

This script gets the current firewall settings for a system and loops through each rule that requires a permit to marking (Permanent Marking) and disables it. After looping through all rules, it also disables any unmarked permanent marked rules that are not set to "Allow" or "DoNotTranslate". 

To disable the firewall completely for a system, you would need to modify the script accordingly.
